        <div className="">
            <Button
                name="x"
                onclick={props.onclickNoButton}
                classname={props.classButtonX}
                title="������� ����?"
                type="button"
                tabindex="-1"
            />
            <div>
                Confirm deleting the item:
             </div>
            <div>
                {props.dataDelete}
            </div>
          

            <WindowButtonsConsole
                nameYesButton= "DELETE"
                onclickYesButton={props.onclickYesButton}

                nameNoButton= "CANCEL"
                onclickNoButton={props.onclickNoButton}

                classWrapper={props.classWrapper}
                classButtonWrapper={props.classButtonWrapper}
                classButton={props.classButton}
            />

        </div>
      
    )
}

export default WindowConfirmDeleting
